import React, { Component } from 'react'
import Axios from 'axios'
class Courses extends Component {

    constructor(props) {
        super(props)

        this.state = {
            allcorse: []
        }
    }
    componentDidMount() {
        console.log(this.props)
        Axios.get(`http://saral.navgurukul.org/api/courses/${this.props.location.state.id}/exercises`)
            .then(posRes => {
                // const allCourses = posRes.data.availableCourses;
                // console.log(posRes.data.data, "poooooooo")
                // this.setState({ allCourses:posRes.data.availableCourses});
                this.setState({ allcorse: posRes.data.data })
            })
            .catch(errRes => {
                console.log(errRes)

            })
    }


    render() {
        const { allcorse } = this.state

        return (
            <>
                <div className="container">
                    {allcorse.map(data =>
                        <div className="card" style={{width: '18rem'}}>
                            <ul className="list-group list-group-flush">
                                <li className="list-group-item">{data. idname}</li>
                            </ul>
                        </div>
                    )}

                </div>


            </>




        )
    }
}
export default Courses;
